import { IConsoleOutputDataReducer } from '../Interface/IConsoleOutputDataReducer'
import { ActionOutputData } from "../Type/ActionOutputData"

export const ConsoleOutputDataReducer = (state : IConsoleOutputDataReducer,action : ActionOutputData) : IConsoleOutputDataReducer => {
    switch(action.type){
        case 'changeAllValue':
            return {output: [...state.output, action.data.output[action.data.output.length]], isDisableWrite: action.data.isDisabledWrite}
        default:
            throw new Error();
    }
}
